Kortney Kane, Brooke Banner, Daisy Cruz - Chesty Cheerleaders Cheat On The Champs

Added: June 15, 2010

Three cheerleaders are stranded on the side of the road after their car breaks down on their way to a football game. They flag down a bus and find out that it's the opposing team's star players! Brooke, Daisy, and Kotney then show how much team spirit they have by distracting their rivals with their tantalizing tits!
